    ): Short
    external fun uniffi_connected_ffi_checksum_func_get_local_fingerprint(
    ): Short
    external fun uniffi_connected_ffi_checksum_func_initialize(
    ): Short
    external fun uniffi_connected_ffi_checksum_func_initialize_with_ip(
