sealed class CallAction {
    
    object Answer : CallAction()
    
    
    object Reject : CallAction()
    
    
    object HangUp : CallAction()
    
    
    object Mute : CallAction()
    
    
    object Unmute : CallAction()
    
    
    object Hold : CallAction()
    
    
    object Unhold : CallAction()
    
    
    data class SendDtmf(
        val `digit`: kotlin.String) : CallAction()
        
    {
        

        companion object
    }
    

    

    
    


    companion object
}

/**
 * @suppress
 */
public object FfiConverterTypeCallAction : FfiConverterRustBuffer<CallAction>{
    override fun read(buf: ByteBuffer): CallAction {
        return when(buf.getInt()) {
            1 -> CallAction.Answer
            2 -> CallAction.Reject
            3 -> CallAction.HangUp
            4 -> CallAction.Mute
            5 -> CallAction.Unmute
            6 -> CallAction.Hold
            7 -> CallAction.Unhold
            8 -> CallAction.SendDtmf(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: CallAction) = when(value) {
        is CallAction.Answer -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.Reject -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.HangUp -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.Mute -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.Unmute -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.Hold -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.Unhold -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
            )
        }
        is CallAction.SendDtmf -> {
            // Add the size for the Int that specifies the variant plus the size needed for all fields
            (
                4UL
                + FfiConverterString.allocationSize(value.`digit`)
            )
        }
    }

    override fun write(value: CallAction, buf: ByteBuffer) {
        when(value) {
            is CallAction.Answer -> {
                buf.putInt(1)
                Unit
            }
            is CallAction.Reject -> {
                buf.putInt(2)
                Unit
            }
            is CallAction.HangUp -> {
                buf.putInt(3)
                Unit
            }
            is CallAction.Mute -> {
                buf.putInt(4)
                Unit
            }
            is CallAction.Unmute -> {
                buf.putInt(5)
                Unit
            }
            is CallAction.Hold -> {
                buf.putInt(6)
                Unit
            }
            is CallAction.Unhold -> {
                buf.putInt(7)
                Unit
            }
            is CallAction.SendDtmf -> {
                buf.putInt(8)
                FfiConverterString.write(value.`digit`, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }
}






