        val len = buf.getInt()
        return List<FfiFsEntry>(len) {
            FfiConverterTypeFfiFsEntry.read(buf)
        }
    }

    override fun allocationSize(value: List<FfiFsEntry>): ULong {
        val sizeForLength = 4UL
        val sizeForItems = value.map { FfiConverterTypeFfiFsEntry.allocationSize(it) }.sum()
        return sizeForLength + sizeForItems
    }

    override fun write(value: List<FfiFsEntry>, buf: ByteBuffer) {
        buf.putInt(value.size)
        value.iterator().forEach {
            FfiConverterTypeFfiFsEntry.write(it, buf)
        }
    }
}




